  return (
    <div
      onClick={() => onClick(emotion_id)}
      className={`EmotionItem ${emotion_clicked}`}
    >
      <img src={emotion_img}></img>
      <span>{emotion_discript}</span>
    </div>
  );
};

export default EmotionItem;
